import {Register} from "../../genes/Register.js"

const $global = Register.$global

export const Iterators = Register.global("$hxClasses")["haxpression.utils.Iterators"] = 
class Iterators {
	static toArray(iterator) {
		let result = [];
		let value = iterator;
		while (value.hasNext()) {
			let value1 = value.next();
			result.push(value1);
		};
		return result;
	}
	static get __name__() {
		return "haxpression.utils.Iterators"
	}
	get __class__() {
		return Iterators
	}
}

